    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from May through August
    of 1953. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, predators, and raptors- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, and wildfires. Resource
    management is outlined; topics include grazing, haying, and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, and fishing. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
